//每次数据渲染完成后触发事件
app.directive('onfinishrenderfilters', function ($timeout) {
    return {
        restrict: 'A',
        link: function (scope, element, attr) {
            if (scope.$last === true) {    //判断是否是最后一条数据
                $timeout(function () {
                    scope.$emit('ngRepeatFinished'); //向父级scope传送ngRepeatFinished命令
                });
            }
        }
    };
});

//从第一个页面跳转第二个页面需要传递的参数
app.factory('ProposalFactory', function(){
    var proposalGroups = {}, maxKey = 0, cost = {}, splitGranularity = {},
        sharingTableGroups = [], allTables = [], costProportion = 0;
    var factory = {};
    factory.setProposal = function(a, b, c, d,e, f, g){
        proposalGroups = a;
        maxKey = b;
        cost = c;
        splitGranularity = d;
        sharingTableGroups = e;
        allTables = f;
        costProportion = g;
    };

    factory.getCostProportion = function(){
        return costProportion;
    };

    factory.getProposalGroups = function(){
        return proposalGroups;
    };

    factory.getMaxKey = function(){
        return maxKey;
    };

    factory.getCost = function(){
        return cost;
    };

    factory.getSplitGranularity = function(){
        return splitGranularity;
    };

    factory.getSharingTableGroups = function(){
        return sharingTableGroups;
    };

    factory.getAllTables = function(){
        return allTables;
    };

    return factory;
});

