app.factory('CostService', function ($http, $q) {
    var service = {};
    //获取并返回数据
    service.calCost = function (idList) {
        var deferred = $q.defer();
        var promise = deferred.promise;
        $http({
            method: "post",
            url: "/splitCost",
            contentType: "application/json",
            dataType: "json",
            data:idList,
            withCredentials: true
        }).success(function (data) {
            if (data) {
                deferred.resolve(data);
            } else{
                alert("Request the split cost fail!" + data.message);
            }
        });

        return promise;
    };
    return service;
});

app.factory('UploadFileService', function ($http, $q) {
    var service = {};
    //获取并返回数据
    service.upload = function (form) {
        var deferred = $q.defer();
        var promise = deferred.promise;
        $http({
            method: "post",
            url: "/uploadFile2",
            data:form,
            withCredentials: true,
            headers: {'Content-Type':undefined},
            transformRequest: angular.identity
        }).success(function () {
            alert("Upload success!");
            deferred.resolve("success");
        });
        return promise;
    };
    return service;
});



